import logo from './logo.svg';
import './App.css';
import * as bip39 from "bip39";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

          <Bip39/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

/**
 * @return {string}
 */
function Bip39() {
  const bip30Str = bip39.generateMnemonic();
  const seed= bip39.mnemonicToSeedSync(bip30Str).toString('hex');
  return <p>{bip30Str}</p> + <p>{seed}</p>
}


export default App;
